body:
Fix #805. Add support for `load_in_8bit` and `load_in_4bit` 

```
-- BitsAndBytes support
SELECT pgml.transform(
    task => '{
      "task": "text-generation",
      "model": "bigscience/bloom-1b7",
      "device_map": "auto",
      "load_in_4bit": true
    }'::JSONB,
    inputs => ARRAY[
        'Once upon a time,'
    ],
    args => '{"max_new_tokens": 32}'::JSONB
);
```
